const StackApp = createStackNavigator();
export default function Navigator() {
  return (
    <NavigationContainer>
     <StackApp.Navigator initialRouteName="Basic">
        <StackApp.Screen name="HomeApp" component= {TabNavigator} options={navOptionHandler}/>
      </StackApp.Navigator>
    </NavigationContainer>
  );
}
